        {id: 3, title: 'C++', description: 'You lost 2gb or RAM because of carelessness'}
    ]);
    console.log(posts);
    console.log(typeof posts);
    return (
        <div className="App">
            <AllPosts posts={posts} title={"Posts about programming languages"} />
        </div>
    );
}

